import Carousel from "./Carousel";
import AY from '../resources/AY_Logo.png';

const Feed = () =>{
  return(
    <div className="flex bg-green mt-3">
        <div className="flex flex-1 mr-2 bg-slate-500">
          <div >
            <img src={AY} alt="profilepic" className="border-2 w-2/6 rounded-full"/>
          </div>
          <div>
            <h4>Joshua Daquila</h4>
          </div>
        </div>
        <div className="flex flex-1 bg-slate-500">
          <h1>Photos Container</h1>
        </div>
    </div>
  )
}
export default Feed;
